files.content:
[workspace]
members = [
    "cli",
    "crates/*",
    "crates/core/derive",
    "crates/codederror/derive",
    "server",
    "benchmarks",
    "tools/bifrost-benchpress",
    "tools/mock-service-endpoint",
    "tools/restatectl",
    "tools/service-protocol-wireshark-dissector",
    "tools/xtask",
    "workspace-hack",
]
default-members = [
    "cli",
    "crates/*",
    "crates/core/derive",
    "crates/codederror/derive",
    "server",
    "tools/restatectl",
]
resolver = "2"

[workspace.package]
version = "1.1.6"
authors = ["restate.dev"]
edition = "2021"
rust-version = "1.82.0"
license = "BUSL-1.1"
repository = "https://github.com/restatedev/restate"
description = "Restate makes distributed applications easy!"

